transforms.result:
@use '@/assets/scss/main.scss' as *;


.header {
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.search-form {
  display: flex;
  align-items: center;
}

.search-form input[type="text"],
.search-form button {
  margin-right: 10px; /* Промежуток между полем и кнопкой */
}

.course-card {
  border: 1px solid $blue;
  border-radius: 25px;
  padding: 21px 10px;
  display: flex;
  flex-direction: column;
  text-align: center;
  //height: 160px;
  width: 195px;
  user-select: none;
  cursor: pointer;
  @include theme('background', $divider-color);
}

.block-courses > div:hover:hover {
  transform: scale(1.01);
}

.course-card img {
  display: block;
  margin: auto;
  width: 90%;
}

.block-courses > div {
  transition: .3s;
  margin: 10px;
}

.block-courses {
  display: flex;
  gap: 30px;
  flex-wrap: wrap;
  justify-content: center;
  padding: 20px;
}

.block-courses p {
  margin-top: 20px;
  word-wrap: break-word;
  @include theme('color', $primary-text-color);
}

a {
  color: #121212;
  text-decoration: none;
}
